import React, { useState, useEffect } from 'react';
import apiCaller from '../../utils/apiCaller';
const MoMo = () => {
  apiCaller('api/momo', 'post').then((res) => {
    testData = res;
  });
  return <div>{testData}</div>;
};

export default MoMo;
